class Solution(object):
        def countHomogenous(self, s):
            total = 1
            count = 1

            for i in range(1, len(s)):
                if s[i] == s[i-1]:
                    count += 1
                else: count = 1
                
                total += count % (10**9 + 7)
            
            return total

sol = Solution()
s = "abbcccaa"
# s = 'zzzzz'
# s = ""
print(sol.countHomogenous(s))
